Information
------------------------------

Wild Venice
Who would have thought Venice has its own beautiful reefs? The TegnÃƒÆ’Ã‚Â¹e, located on the east end of the Lagoon, are home to an astonishing diversity of life, from sponges and sea anemones to scribbled pipefish and flashing squid. Like all the other amazing wildlife, the TegnÃƒÆ’Ã‚Â¹e have been influenced, perhaps created, by centuries of human geo-engineering. The Grand Canal itself is actually the mouth of the river Brenta, descending 200 kms from the Alps! The Lagoon is a hot-spot for exotic birds heading north in spring - year after year, more than 60 species stop at the Lagoon, their first feeding ground after crossing the Mediterranean. Venice's fabulous hidden gardens are hiding-places for pine-martens and geckos, while kestrels use abandoned monasteries to breed, and launch hunting expeditions. This film reveals the unexpected natural glories of the world's most beautiful man-made environment.

